function Home() {
  return (
    <div
      style={{
        alignItems: "center",
        display: "flex",
        height: "100vh",
        justifyContent: "center"
      }}
    >
      <div
        style={{
          marginBottom: "40px",
          width: "320px"
        }}
      >
        <div
          style={{
            fontSize: "32px",
            fontWeight: "800",
            lineHeight: "35px",
            marginBottom: "20px"
          }}
        >
          Jamil Abreu
        </div>
        <div
          style={{
            display: "flex",
            lineHeight: "19px",
            marginBottom: "15px"
          }}
        >
          <img
            src="/static/images/me.png"
            style={{ borderRadius: "4px", height: "50px", marginRight: "15px" }}
          />
          ai! welcome, friend. a few quick facts about me:
        </div>
        <div><ul><li>work at<a href="https://automattic.com/about/" target="_blank">Automattic</a></li><li>did some stuff with <a href="http://www.nytimes.com/2010/05/08/sports/baseball/08drugs.html?_r=0" target="_blank">MLB</a></li><li>started an awesome <a href="http://on.fb.me/1sCCSCa" target="_blank">conference</a></li><li><a href="http://gladwell.com/are-you-a-connector/" target="_blank">connecting</a> people makes me happy</li><li>sometimes i write words + code</li></ul></div>
      </div>
    </div>
  );
}

export default Home;
